import React from 'react';
import {
    Container
} from '@mui/material';
import bghero from './hero.jpg'

const heroStyle = {
    height: '90vh',
    width: '100vw',
    backgroundImage:`url(${bghero})`,
    backgroundSize: 'cover',
    borderTop:'solid black .35rem',
    borderBottom:'solid black .35rem',
    marginTop: '-2rem'
}

const Hero = () => {
    return (
        <Container
            sx={heroStyle}
            maxWidth={false} //this takes off default width limit
        >

        </Container>
    )
}

export default Hero;
